import React from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const data = [
    {
        name: '2007', 'Series 1': 20, 'Series 2': 10
    },
    {
        name: '2008', 'Series 1': 55, 'Series 2': 45
    },
    {
        name: '2009', 'Series 1': 45, 'Series 2': 35
    },
    {
        name: '2010', 'Series 1': 75, 'Series 2': 65
    },
    {
        name: '2011', 'Series 1': 50, 'Series 2': 40
    },
    {
        name: '2012', 'Series 1': 75, 'Series 2': 65
    },
    {
        name: '2013', 'Series 1': 100, 'Series 2': 90
    }
];

const LineAngleChart = () => {
    return (
        <React.Fragment>
            <ResponsiveContainer width="100%" height={300}>
                <LineChart
                    data={data}
                    margin={{
                        top: 20, right: 30, left: 20, bottom: 5,
                    }}>
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis type="number" />
                    <Tooltip />
                    <Legend />
                    <Line dataKey="Series 1" stroke="#2ed8b6" strokeWidth={3} />
                    <Line dataKey="Series 2" stroke="#73b4ff" strokeWidth={3} />
                </LineChart>
            </ResponsiveContainer>
        </React.Fragment>
    );
}

export default LineAngleChart;
